import React, { useEffect } from 'react';
import axios from 'axios';
import './Hero.css';

const BASE_URL = 'http://localhost:5000/api';

export const Hero = () => {
  useEffect(() => {
    axios.get(`${BASE_URL}/hero`)
      .then(response => {
        console.log('Hero loaded', response);
      })
      .catch(error => {
        console.error('Error loading hero', error);
      });
  }, []);

  return (
    <section className="hero">
      <img className="printer-hero" src="/printerlo.jpg" alt="Featured Printer" />
      <h2>Top Printer Deals</h2>
      <p>Explore our range of printers that combine functionality, quality, and performance...</p>
    </section>
  );
};
